assert rubi_integrate(1/(a + x*sqrt(a)), x) == log(x + sqrt(a))/sqrt(a)
assert rubi_integrate(1/(a + x*sqrt(-a)), x) == log(a + x*sqrt(-a))/sqrt(-a)
