assert rubi_integrate((a + b*x)**n*(c + d*x)**(-2-n), x) == (a + b*x)**(1 + n)*(c + d*x)**(-1-n)/((b*c-a*d)*(1 + n))
assert rubi_integrate((a + b*x)**n*(c + d*x)**(-3-n), x) == (a + b*x)**(1 + n)*(c + d*x)**(-2-n)/((b*c-a*d)*(2 + n)) + b*(a + b*x)**(1 + n)*(c + d*x)**(-1-n)/((b*c-a*d)**2*(1 + n)*(2 + n))
assert rubi_integrate((a + b*x)**n*(c + d*x)**(-4-n), x) == (a + b*x)**(1 + n)*(c + d*x)**(-3-n)/((b*c-a*d)*(3 + n)) + 2*b*(a + b*x)**(1 + n)*(c + d*x)**(-2-n)/((b*c-a*d)**2*(2 + n)*(3 + n)) + 2*b**2*(a + b*x)**(1 + n)*(c + d*x)**(-1-n)/((b*c-a*d)**3*(1 + n)*(2 + n)*(3 + n))
assert rubi_integrate((a + b*x)**n*(c + d*x)**(-5-n), x) == (a + b*x)**(1 + n)*(c + d*x)**(-4-n)/((b*c-a*d)*(4 + n)) + 3*b*(a + b*x)**(1 + n)*(c + d*x)**(-3-n)/((b*c-a*d)**2*(3 + n)*(4 + n)) + 6*b**2*(a + b*x)**(1 + n)*(c + d*x)**(-2-n)/((b*c-a*d)**3*(2 + n)*(3 + n)*(4 + n)) + 6*b**3*(a + b*x)**(1 + n)*(c + d*x)**(-1-n)/((b*c-a*d)**4*(1 + n)*(2 + n)*(3 + n)*(4 + n))
assert rubi_integrate((a + b*x)**(-2 + n)*(c + d*x)**(1-n), x) == -(b*c-a*d)*(a + b*x)**(-1 + n)*(b*(c + d*x)/(b*c-a*d))**n*hypergeom([-1 + n,-1 + n],[n],-d*(a + b*x)/(b*c-a*d))/(b**2*(1-n)*(c + d*x)**n)
assert rubi_integrate((a + b*x)**(1 + n)*(c + d*x)**(-1-n), x) == (b*c-a*d)*(a + b*x)**n*hypergeom([-1-n,-n],[1-n],b*(c + d*x)/(b*c-a*d))/(d**2*n*(-d*(a + b*x)/(b*c-a*d))**n*(c + d*x)**n)

#  Pseudo-symbolic exponent must be recognized as equal to -1. 
assert rubi_integrate((a + b*x)**m*(c + d*x)**(1 + 2*n-2*(1 + n)), x) == (a + b*x)**(1 + m)*hypergeom([1,1 + m],[2 + m],-d*(a + b*x)/(b*c-a*d))/((b*c-a*d)*(1 + m))
assert rubi_integrate((c + d*x)**(1 + 2*n-2*(1 + n))/(a + b*x)**2, x) == (-1)/((b*c-a*d)*(a + b*x))-d*log(a + b*x)/(b*c-a*d)**2 + d*log(c + d*x)/(b*c-a*d)**2
assert rubi_integrate((a + b*x)**m*(a*c*(1 + m) + b*c*(2 + m)*x)**(-3-m), x) == -(a + b*x)**(1 + m)*(a*c*(1 + m) + b*c*(2 + m)*x)**(-2-m)/(a*b*c*(2 + m)) + (a + b*x)**(1 + m)*(a*c*(1 + m) + b*c*(2 + m)*x)**(-1-m)/(a**2*b*c**2*(2 + 3*m + m**2))
assert rubi_integrate((a + b*x)**(-1-b*c/(b*c-a*d))*(c + d*x)**(-1 + a*d/(b*c-a*d)), x) == -(c + d*x)**(a*d/(b*c-a*d))/(b*c*(a + b*x)**(b*c/(b*c-a*d))) + (c + d*x)**(a*d/(b*c-a*d))/(a*b*c*(a + b*x)**(a*d/(b*c-a*d)))
assert rubi_integrate((a + b*x)**((-2*b*c + a*d)/(b*c-a*d))*(c + d*x)**((b*c-2*a*d)/(-b*c + a*d)), x) == -(c + d*x)**(a*d/(b*c-a*d))/(b*c*(a + b*x)**(b*c/(b*c-a*d))) + (c + d*x)**(a*d/(b*c-a*d))/(a*b*c*(a + b*x)**(a*d/(b*c-a*d)))
assert rubi_integrate((1-x)**n/sqrt(1 + x), x) == 2**(1 + n)*hypergeom([1/2,-n],[3/2],1/2*(1 + x))*sqrt(1 + x)
assert rubi_integrate((1 + x)**n/sqrt(1-x), x) == -2**(1 + n)*hypergeom([1/2,-n],[3/2],1/2*(1-x))*sqrt(1-x)
assert rubi_integrate((1-x)**n*(1 + x)**(7/3), x) == 3/5*2**(-1 + n)*(1 + x)**(10/3)*hypergeom([10/3,-n],[13/3],1/2*(1 + x))
assert rubi_integrate((1-x)**(7/3)*(1 + x)**n, x) == -3/5*2**(-1 + n)*(1-x)**(10/3)*hypergeom([10/3,-n],[13/3],1/2*(1-x))
assert rubi_integrate((2 + 3*x)**m/(1 + 2*x)**m, x) == 2**(-1-m)*(1 + 2*x)**(1-m)*hypergeom([1-m,-m],[2-m],-3*(1 + 2*x))/(1-m)
assert rubi_integrate((d*(a + b*x)/(-b*c + a*d))**m*(c + d*x)**n, x) == (c + d*x)**(1 + n)*hypergeom([-m,1 + n],[2 + n],b*(c + d*x)/(b*c-a*d))/(d*(1 + n))

# Multinomial integrands

# Polynomial integrands
assert rubi_integrate(a + b*x + c*x**2 + d*x**3, x) == a*x + 1/2*b*x**2 + 1/3*c*x**3 + 1/4*d*x**4
assert rubi_integrate(-x**3 + x**4, x) == -1/4*x**4 + 1/5*x**5
assert rubi_integrate(-1 + x**5, x) == -x + 1/6*x**6
assert rubi_integrate(7 + 4*x, x) == 7*x + 2*x**2
assert rubi_integrate(4*x + Pi*x**3, x) == 2*x**2 + 1/4*Pi*x**4
assert rubi_integrate(2*x + 5*x**2, x) == x**2 + 5/3*x**3
assert rubi_integrate(1/2*x**2 + 1/3*x**3, x) == 1/6*x**3 + 1/12*x**4
assert rubi_integrate(3-5*x + 2*x**2, x) == 3*x-5/2*x**2 + 2/3*x**3
assert rubi_integrate(-2*x + x**2 + x**3, x) == -x**2 + 1/3*x**3 + 1/4*x**4
assert rubi_integrate(1-x**2-3*x**5, x) == x-1/3*x**3-1/2*x**6
assert rubi_integrate(5 + 2*x + 3*x**2 + 4*x**3, x) == 5*x + x**2 + x**3 + x**4

# Multinomial integrands
assert rubi_integrate(a + d/x**3 + c/x**2 + b/x, x) == -1/2*d/x**2-c/x + a*x + b*log(x)
assert rubi_integrate(1/x**5 + x + x**5, x) == (-1/4)/x**4 + 1/2*x**2 + 1/6*x**6
assert rubi_integrate(1/x**3 + 1/x**2 + 1/x, x) == (-1/2)/x**2 + (-1)/x + log(x)
assert rubi_integrate((-2)/x**2 + 3/x, x) == 2/x + 3*log(x)
assert rubi_integrate((-1/7)/x**6 + x**6, x) == 1/35/x**5 + 1/7*x**7
assert rubi_integrate(1 + 1/x + x, x) == x + 1/2*x**2 + log(x)
assert rubi_integrate((-3)/x**3 + 4/x**2, x) == 3/2/x**2 + (-4)/x
assert rubi_integrate(1/x + 2*x + x**2, x) == x**2 + 1/3*x**3 + log(x)
assert rubi_integrate(x**(5/6)-x**3, x) == 6/11*x**(11/6)-1/4*x**4
assert rubi_integrate(33 + x**(1/33), x) == 33*x + 33/34*x**(34/33)
assert rubi_integrate(1/2/sqrt(x) + 2*sqrt(x), x) == 4/3*x**(3/2) + sqrt(x)
assert rubi_integrate((-1)/x**2 + 10/x + 6*sqrt(x), x) == 1/x + 4*x**(3/2) + 10*log(x)
assert rubi_integrate(1/x**(3/2) + x**(3/2), x) == 2/5*x**(5/2) + (-2)/sqrt(x)
assert rubi_integrate(-5*x**(3/2) + 7*x**(5/2), x) == -2*x**(5/2) + 2*x**(7/2)
assert rubi_integrate(-1/2*x + 2/sqrt(x) + sqrt(x), x) == 2/3*x**(3/2)-1/4*x**2 + 4*sqrt(x)
assert rubi_integrate((-2)/x + x**(3/2) + 1/5*sqrt(x), x) == 2/15*x**(3/2) + 2/5*x**(5/2)-2*log(x)
